import React from "react";
import Track from "../Track/Track";

function Tracklist(props){
    const tracks = props.tracks ? props.tracks : [
        {
            title: "Test title 1",
            artist: "Test artist 1",
            album: "Test album 1",
            id: "1"
        },
        {
            title: "Test title 2",
            artist: "Test artist 2",
            album: "Test album 2",
            id: "2"
        },
        {
            title: "Test title 3",
            artist: "Test artist 3",
            album: "Test album 3",
            id: "3"
        },
    ];

    return (
        <div className="trackList">
            {tracks.map(track => {
                return (
                    <Track title={track.title} artist={track.artist} album={track.album} key={props.id}/> 
                );
            })}
        </div>
    );
}

export default Tracklist;
